import React from "react";
import { Card, Avatar, Button } from 'antd';

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">짹짹<br/>0</div>,
                <div key="followings">팔<br/>0</div>,
                <div key="followings">짹짹<br/>0</div>,
            ]}
        >
            <Card.Meta
                avatar={<Avatar>d3</Avatar>}
                title="djii3386464"
            />
            <Button>로그아웃</Button>
        </Card>
    );
};

export default UserProfile;
